import Styles from "./Card.module.css";

function Card(props) {
  const { card } = props;

  return (
    <div>
      <div className="cardcovid__column">
        <div className="cardcovid__card">
          <h3>{cardcovid.status}</h3>
          <h2>{cardcovid.total}</h2>
        </div>
      </div>
    </div>
  );
}

export default CardCovid;
